 import React from 'react';
import './OurServices.css';

const OurServices = () => {
  const services = [
    { id: 1, title: "Cardiology", description: "Heart-related treatments", img: "service1.png" },
    { id: 2, title: "Neurology", description: "Brain-related treatments", img: "service2.png" },
    { id: 3, title: "Orthopedics", description: "Bone-related treatments", img: "service3.png" },
  ];

  const treatments = [
    { id: 1, title: "Therapy", description: "Rehabilitation services", img: "treatment1.png" },
    { id: 2, title: "Surgery", description: "Advanced surgical procedures", img: "treatment2.png" },
  ];

  return (
    <div className="app-container">
      <h1 className="page-title">Our Services and Treatments</h1>

      <section className="services">
        <h2>Services</h2>
        <div className="vertical-card-container">
          {services.map((service) => (
            <div key={service.id} className="vertical-card">
              <img src={service.img} alt={service.title} />
              <h3>{service.title}</h3>
              <p>{service.description}</p>
            </div>
          ))}
        </div>
      </section>

      <section className="treatments">
        <h2>Treatments</h2>
        <div className="vertical-card-container">
          {treatments.map((treatment) => (
            <div key={treatment.id} className="vertical-card">
              <img src={treatment.img} alt={treatment.title} />
              <h3>{treatment.title}</h3>
              <p>{treatment.description}</p>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default OurServices;
